import React ,{component} from 'react';
import data from './a.json';
var element=data;
class Post extends component{
    constructor(){
        super()
        this.state={
            arr:[]
        }
    }
    componentDidMount()
    {
        element.map((e)=>
            {
                this.setstate({arr:e})
            })
    }

    render()
    {
        return(

            this.state.arr.map((e)=>
            {
                <ui>
                    <li>{e.id}</li>
                    <li>{e.userId}</li>
                    <li>{e.title}</li>
                    <li>{e.body}</li>

                </ui>
            }
            )
        )

    }
}
export default Post;
